CREATE DEFINER=`ottsinc`@`localhost` PROCEDURE `clonarhistoria`(IN  inpaciente VARCHAR(15),IN  norden VARCHAR(15), OUT nuevocodigoh VARCHAR(15) )
BEGIN 


DECLARE done BOOLEAN DEFAULT FALSE; 
declare htipo VARCHAR(1);
declare hcodempresa  int(11);
declare hpaciente int(11);
declare henmision VARCHAR(50);
declare horden int(11);
declare heps VARCHAR(50);
declare hafp VARCHAR(50);
declare harp VARCHAR(50);
declare hestado VARCHAR(11);
declare nuevocodigo VARCHAR(50);
declare sql11 VARCHAR(500);
declare oldcodigo VARCHAR(50);



DECLARE c1 cursor for SELECT h.codigo, h.tipo,h.enmision,h.eps,h.afp,h.arp FROM 	historias h,	orden_actividades o,	pacientes p 
						where	
						h.codorden=o.codigo and	o.codpaciente=p.codigo and p.codigo=1  order by h.codigo desc limit 1;   
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = TRUE;   


open c1;   
c1_loop: LOOP   
fetch c1 into oldcodigo,htipo, henmision,heps,hafp,harp;  
   
 IF done THEN LEAVE c1_loop; END IF; 
select max(codigo)+1 into nuevocodigo from historias;

select 
	a.codempresa into hcodempresa 
from 
	orden_actividades o,
	actividaescontratadas a
where 
	o.codcontrato=a.codigo and
	o.codigo=norden;

#set sql11=concat(nuevocodigo,norden,htipo,hcodempresa,inpaciente,henmision,norden,heps,hafp,harp);


	historias (codigo,codorden,fecha,tipo,codempresa,paciente,enmision,orden,eps,afp,arp,estado)
	VALUES
		(nuevocodigo,norden,now(),htipo,hcodempresa,inpaciente,henmision,norden,heps,hafp,harp,"concepto");

	UPDATE 
		orden_actividades
	SET 
		estado='concepto'
	where 
	codigo=norden;

END LOOP c1_loop;   
CLOSE c1;



call clonarantecedentes(nuevocodigo,oldcodigo);
call clonarconcepto(nuevocodigo,oldcodigo);
call clonardiagnosticos(nuevocodigo,oldcodigo);
call clonarexamenfisico(nuevocodigo,oldcodigo);
call clonarexamenfisicoimc(nuevocodigo,oldcodigo);
call clonarfactores(nuevocodigo,oldcodigo);
call clonarhabitos(nuevocodigo,oldcodigo);
call clonarinformacionocupacional(nuevocodigo,oldcodigo);
call clonarpaciente(nuevocodigo,oldcodigo);
call clonarrevision(nuevocodigo,oldcodigo);
call clonartipo(nuevocodigo,oldcodigo);

#insert into tempclonacion values (inpaciente,norden,nuevocodigo);
set nuevocodigoh=nuevocodigo;

END$$

